import colors from './colors';

export const flexCenter = {
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
};

export const section = {
  borderRadius: '4px',
  boxShadow: '0px 5px 8px 4px rgba(0, 0, 0, 0.2)',
  backgroundColor: colors.lokiBlack80,
  padding: '1rem'
};
